// src/App.js

import React from "react";
import Login from "./components/Login";
import { useAuth0 } from "./react-auth0-wrapper";

function App() {
  const { loading } = useAuth0();

  if (loading) {
    return (
      <div>Loading...</div>
    );
  }

  return (
    <div className="App">
      <header>
        <Login />
      </header>
    </div>
  );
}

export default App;
